import React from 'react';
import './Card.css'

function Card(){
    return(
    <>
        <div className="cards">
            <div className="card">
                <div className="img"><img src="E:\react\pratice1\src\img\f3.PNG" alt="error" /></div>
                <div className="title">A Netflix Original</div>
                <div className="sname">Dark</div>
                <div className="btn">WATCH NOW</div>

            </div>
        </div>
    </>
    );
}

export default Card;
